const About=()=>{
    return(
        <>
        <Same
        title="Know More About Us"
        text="Welcome to our course app! We're a team of experienced developers and educators who are passionate about teaching the latest in web development, front-end design, and full-stack development. Our mission is to empower students of all levels with the skills and knowledge they need to succeed in today's fast-paced tech industry. Our courses are designed to be comprehensive, yet accessible, and we offer a range of resources and support to help you along the way. Whether you're a beginner or an experienced coder, we have something for you. Join us today and take your coding skills to the next level!



        Check out our courses:



        Web Development: https://dummylink.com/web-dev

        Front End Design: https://dummylink.com/front-end

        Full Stack Development: https://dummylink.com/full-stack."
        imgsrc={aboutusimg}
        btn="Know More"
    />
        </>
    )
}
export default About;
